export const ADD_FAVORITE = 'ADD_FAVORITE';
export const NEXT_MOVIE = 'NEXT_MOVIE';

export const addFavorite = () => {
  return {
    type: ADD_FAVORITE,
  };
};

export const nextMovie = () => {
  return {
    type: NEXT_MOVIE,
  };
};
